typeql:
match
  $s isa stream, has description $d;
  $d like ".*hilarious moments.*";
  (streaming_channel: $s, played_game: $g) isa game_play;
fetch { "game": $g };

match
  $s isa stream, has description $d;
  $d like ".*strategy.*";
  (channel: $s, used_language: $l) isa language_usage;
fetch { "language": $l };
